import React, { Component } from 'react';
// eslint-disable-next-line
import { useLocation } from 'react-router-dom'

import LoggedInTester from '../buttons/LoggedInTester';

const Course = ({ course_dept, course_num }) => (
    <div>
        <p>{course_dept}</p>
        <p>{course_num}</p>
    </div>
);


class Courses extends Component {

    constructor(props) {
        super(props);
        this.state = { 
            foo: [],
        };

        this.getCourses = this.getCourses.bind(this);
    }

    async getCourses() {
        const res = await fetch(`http://127.0.0.1:8000/tutoring/get_courses_sample/`);
        const data = await res.json();
        return data.results;
    }


    async componentDidMount() {
        const foo = await this.getCourses();
        this.setState({ foo });
    }
    
    render() {
      return (
        <div>
          {this.state.foo.map((course) => (
                <Course
                    course_dept={course.course_dept}
                    course_num={course.picture.course_num}
                />
          ))}
        </div>
      );
    }


  }

  export default Courses
